import React from 'react'
import {CreateAncmntAuctionContainer} from '@src/components/announcement_auction/create_ancmnt_auction/CreateAncmntAuctionContainer'
import {withTranslation} from "next-i18next";

const Create = (props) => {
    return <CreateAncmntAuctionContainer {...props} />
}

Create.getInitialProps = async () => ({
    namespacesRequired: ['ancmnt', 'common'],
});

export default withTranslation(['ancmnt', 'common'])(Create);
